import React from 'react';
import apple from './apple.png';
import search from './search.png';

const Nav = () => {

    return(
        <div>
            <nav>
                {/* top left of navbar */}
                <div className='leftNav'>
                    <img alt='' src={apple}></img>
                    <div>Finder</div>
                    <div className='middleLeftNav'>
                        <div>Edit</div>
                        <div>View</div>
                        <div>Go</div>
                        <div>Window</div>
                    </div>
                    <div>Home</div>
                </div>
                {/* top right of navbar */}
                <div className='rightNav'>
                <img src={search} alt=''></img>   
                </div>
            </nav>
        </div>
    )
}

export default Nav;
